-- ----------------------------
-- Table structure for hr_employee
-- ----------------------------
DROP TABLE IF EXISTS `hr_employee`;
CREATE TABLE `hr_employee` (
  `id` bigint(19) NOT NULL AUTO_INCREMENT COMMENT '自增主键 ',
  `employee_id` varchar(24) DEFAULT NULL COMMENT '证件号+证件类型 唯一字段',
  `identity_type` int(11) DEFAULT NULL COMMENT '证件类型 - 1 身份证, 2 护照',
  `identity_id` varchar(20) DEFAULT NULL COMMENT '证件号',
  `name` varchar(50) DEFAULT NULL COMMENT '姓名',
  `gender` int(11) DEFAULT NULL COMMENT '性别 0-女 1-男',
  `birth` date DEFAULT NULL COMMENT '出生日期',
  `birth_year` int(11) DEFAULT NULL COMMENT '出生日期-年',
  `birth_month` int(11) DEFAULT NULL COMMENT '出生日期-月',
  `birth_day` int(11) DEFAULT NULL COMMENT '出生日期-日',
  `image_path` varchar(255) DEFAULT NULL COMMENT '头像保存地址 图像服务器-保存图片地址 图片删除修改',
  `age` int(11) DEFAULT NULL COMMENT '员工年龄 ',
  `tall` varchar(24) DEFAULT NULL COMMENT '身高cm',
  `blood_type` varchar(24) DEFAULT NULL COMMENT '血型',
  `nation` int(11) DEFAULT NULL COMMENT '国籍 1-中国 2- 外国',
  `jiguan` int(11) DEFAULT NULL COMMENT '籍贯 关联籍贯表',
  `birth_place` int(11) DEFAULT NULL COMMENT '出生地 关联籍贯表 ',
  `ethic` int(11) DEFAULT NULL COMMENT '民族 关联民族表',
  `marital_status` int(11) DEFAULT NULL COMMENT '婚姻情况 0 未婚 1 已婚 2 离异',
  `have_child` int(11) DEFAULT NULL COMMENT '生育情况 1 未育	 2 一孩 3 二孩 4 多孩',
  `politic_face` int(11) DEFAULT '0' COMMENT '政治面貌 1 党员 2 预备党员 3 团员 4 其他党派 5 群众',
  `join_party_date` date DEFAULT NULL COMMENT '入党时间 填写到月份',
  `full_party_date` date DEFAULT NULL COMMENT '入党转正时间',
  `local_party_branch` varchar(80) DEFAULT NULL COMMENT '所在党支部 ',
  `party_job` int(11) DEFAULT NULL COMMENT '党内职务 创建表关联',
  `work_date` date DEFAULT NULL COMMENT '参加工作时间 选择到月份',
  `join_date` date DEFAULT NULL COMMENT '入职时间 选择到日 无线电集团入职时间 集团司龄	还有一个公司司龄',
  `employment_category` int(11) DEFAULT NULL COMMENT '用工类别',
  `job_status` int(10) unsigned DEFAULT NULL COMMENT '员工状态',
  `phone` varchar(11) DEFAULT NULL COMMENT '手机号码',
  `office_telephone` varchar(24) DEFAULT NULL COMMENT '办公电话',
  `email` varchar(60) DEFAULT NULL COMMENT '电子邮箱',
  `address` varchar(200) DEFAULT NULL COMMENT '联系地址',
  `emerg_cont_person` varchar(40) DEFAULT NULL COMMENT '紧急联系人',
  `emerg_cont_methon` varchar(40) DEFAULT NULL COMMENT '紧急联系方式',
  `emerg_cont_addr` varchar(200) DEFAULT NULL COMMENT '紧急联系人地址',
  `emp_code` varchar(40) DEFAULT NULL COMMENT '录入管理员的员工代码 --对应的公司代码',
  `table_date` datetime DEFAULT NULL COMMENT '修改和删除，都是重新添加一条记录',
  `table_status` int(11) DEFAULT NULL COMMENT '状态 0 删除 1 可用 2 修改 3 彻底删除 4-草稿 5-缓存',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=16591 DEFAULT CHARSET=utf8 COMMENT='员工表';

